    return(
        <nav>
            <div>
            <a href="#" className="logo">Anime.</a>
            </div>
            <div>
            <ul className="navli">
                <li><a href="#">Home</a></li>
                <li><a href="#">Anime</a></li>
                <li><a href="#">Manga</a></li>
            </ul>
            </div>
        </nav>
    );
}
